import React, { Component } from 'react';
import ClassroomService from '../../services/ClassroomService';
import FindClassView from '../../components/view/FindClassView';
import TopNav from '../../components/topnav/TopNav';



class FindClass extends Component {

    constructor(props) {
        super(props)
        this.state = {
            classrooms: []
        }
    }
    componentDidMount() {
        ClassroomService.getClassrooms().then((res) => {
            this.setState({ classrooms: res.data });
        });
    }
    
    render() {
        // const search = (searchInput, filter) => {
        //     ClassroomService.
        // }
        return (
            <div className='findClass'>
                <TopNav/>
                <FindClassView classroomList= {this.state.classrooms}/>
            </div>
            
        )
    }
}
export default FindClass;
